const initalSate = [
  {
    id: 1,
    name: "Iphone 7 plus",
    image: "",
    description: "",
    price: 500,
    inventory: 10,
  },
];

const product = (state = initalSate, action) => {
  switch (action) {
    default:
      return [...state];
  }
};
